let cartItemIds = new Array(); 
var table;
window.onload = function () {
    table = document.getElementById("cartTbl");
    let lsd = localStorage.getItem("cart_item_ids");
    cartItemIds = lsd==null?[]:JSON.parse(lsd); 
    for (let id of cartItemIds){
        addToCartTable(id);
    }
    showAllProducts();
}
function showAllProducts() {
    let pr = document.getElementById("productsRow");

    for (let item of productsArray) {
        let stars = formStars(item.ratings);
        let d = 100-((item.price/item.mrp)*100);
        let p = `<div class="col-md-3">
        <div class="itemDiv">
            <div class="pImg">
                <img src="${item.img}">
            </div>
            <div class="itemDetails">
                <p class="itemName">${item.name}</p>
                <div class="ratings">
                    ${stars}
                </div>
                <div class="row priceRow">
                    <div class="col-md-6 mrp">
                        &#8377; ${item.mrp}
                    </div>
                    <div class="col-md-6 price">
                        &#8377; ${item.price}
                    </div>
                </div>
                <p class="discount">${ Math.round(d)}% off</p>
                <button class="btn btn-info" onclick="onAddToCart(${item.id})"><i class="fa fa-cart-plus" aria-hidden="true"></i> Add To Cart</button>
            </div>
        </div>
    </div>`;
        pr.insertAdjacentHTML("beforeend", p);
    }
}


function formStars(r) {
    let stars = "";
    for (let i = 0; i < Math.floor(r); i++) {
        stars += `<i class="fa fa-star" aria-hidden="true"></i>`;
    }
    if (r - Math.floor(r) == 0.5) {
        stars += `<i class="fa fa-star-half-o" aria-hidden="true"></i>`;
    }
    for (let i = 0; i < 5 - Math.round(r); i++) {
        stars += `<i class="fa fa-star-o" aria-hidden="true"></i>`;
    }
    return stars;
}
function onAddToCart(id) {
    cartItemIds.push(id);
    addToCartTable(id);
    localStorage.setItem("cart_item_ids", JSON.stringify(cartItemIds));
}


function addToCartTable(id) {
    let sno = table.rows.length
    for (let item of productsArray) {
        if (item.id === id) {
            let tRow = `<tr>
                    <td><img class="cartImg" src="${item.img}"></td>
                    <td>${item.name}</td>
                    <td>${item.price}</td>
                    <td><i class="fa fa-times" aria-hidden="true" onclick="onDelete(${sno})"></i></td>
            </tr>`;
            table.insertAdjacentHTML("beforeEnd", tRow);
        }
    }
}

function onDelete(ind) {
    cartItemIds.splice(ind - 1, 1);
    localStorage.setItem("cart_item_ids", JSON.stringify(cartItemIds));
    while (table.rows.length > 1) {
        table.deleteRow(1);
    }
    for (let id of cartItemIds) {
        addToCartTable(id);
    }
}

function onEmptyCart(){
    cartItemIds = [];
    localStorage.setItem("cart_item_ids", JSON.stringify(cartItemIds));
    while (table.rows.length > 1) {
        table.deleteRow(1);
    }
}

function openCartDialog(){
    $(cartModal).modal("show");
}

$(document).keyup(function(e){
    if(e.keyCode == 27){
        $(cartModal).modal("hide");
    }
})